 "data": "{\"name\":\"浙一医院\",\"address\":\"浙江省杭州市庆春路79号\",\"phone\":\"0571-87236666\",\"site\":\"\",\"intro\":\"历史底蕴： 1947年11月，浙江大学竺可桢校长远见卓识，运筹于胸，宏图甫展，购置了田家园6号、9号民宅作为医院用房，面积约2770平米，占地3亩8分，创建了浙江大学医学院附属医院（浙大医院），立意要把医院创建成“南方协和”，一所小小医院，胸怀大目标。开院之初，设施简陋，诸多不备，举步维艰。员工66人，床位65张，人称“弄堂医院”。首任院长王季午教授言传身教，不辱使命，秉承求是学风，以科学的理念管理医院，培育学术氛围，使“严谨求实”成为医院深厚底蕴中最基本最核心的文化基因和元素，贯穿医院整个历程，文化血脉一直延续，内涵日臻丰富，对医院的发展影响深广。在后来六十余年的历史演绎中，医院励精图治，成效卓著，硕果累累，为我省乃至我国的卫生事业的发展作出了不可磨灭的贡献，彪炳史册。 医院今貌： 浙江大学医学院附属一院（浙江省第一医院）系三级甲类综合性医院，是浙江省医疗、教学、科研指导中心之一。医院现有职工3780余人，其中高级职称医护专家430余人，有中国工程院院士2名、长江特聘教授2名、长江讲座教授2名、“千人计划”1名、国家杰出基金获得者2名、求是特聘教授2名。占地面积150余亩，分为庆春、城站和大学路三个院区，核定床位2500张。2009年医院门急诊达到256万人次，出院病人达到7.1人次，手术达到3.4人次，医院总收入21.7亿元。\",\"geoLat\":30.263338,\"geoLng\":120.184563,\"code\":12,\"province\":\"浙江省\",\"city\":\"杭州市\",\"county\":\"西湖区\",\"level\":\"一级\",\"imageId\":\"图片id\",\"hospitalSupportWebAccountId\":943,\"hospitalType\":1,\"nurseDir\":\"小鲍\",\"nurseDirPhone\":\"2883936\",\"followUp\":1,\"satisfaction\":1,\"nurseTrain\":1,\"inner\":1,\"supportWebAccountId\":6901}"
